/************************************************************
3 ‚Äì Escreva um programa em C que pe√ßa ao usu√°rio para digitar 
um texto e um caractere (vogal ou consoante), sendo uma entrada 
por linha. A sa√≠da deve mostrar o n√∫mero de vogais do texto 
digitado e imprimir um novo texto: as vogais do texto
original devem ser substitu√≠das pelo caractere digitado.
*************************************************************/
#include <stdio.h>
#include <string.h>

int main()
{
    
//declara√ß√£o
    int i,soma=0,tamanho;
    char frase[200],caractere;

    
//c√≥digo de entrada
    printf("Insira um texto sem acentos: \n");
    fgets(frase,199,stdin);
    printf("\nAgora insira um caractere(vogais ou consoantes apenas: \n");
    scanf("%s",&caractere);

//la√ßo de leitura e condicional para substituir as vogais
    tamanho=strlen(frase);
    for(i=0;i<tamanho;i++){
        if  (frase[i]=='a'||frase[i]=='e'||frase[i]=='i'||frase[i]=='o'||frase[i]=='u'//min√∫sculas sem acento
           ||frase[i]=='A'||frase[i]=='E'||frase[i]=='I'||frase[i]=='O'||frase[i]=='U'){//mai√∫sculas sem acento
            frase[i]=caractere;
        }    
    }
    
//c√≥digo de sa√≠da
    fputs(frase,stdout);
    return 0;
}

